import React from 'react'
import Base from '../core/Base'

const  ProductionDash=({match})=> {
    const productionId=match.params.productionId;
    const infoFlow=()=>{
        return(
            <div className="row card">
        <h4 className="card-header bg-dark text-white text-center">Information Flow</h4>


          </div>
        )
    }




    return (
        <Base
      title=""
      description=""

    >
    <div className="row">
    <div className="col-12">
    {infoFlow()}


    </div>

    </div>

    </Base>
    )
}

export default ProductionDash
